  false,\n\t\"url\": null,\n\t\"notes\": \"The Iowa Natural Areas Inventory (INAI)
  provides threatened, endangered, special concern, and selected rare species data
  and maps to the public.  Information in the database is from a variety of sources,
  including surveys to locate rare plants and animals in their natural habitats, collection
  of information from museums, herbariums, and scientific literature, and observations
  from naturalists around the state. Over 8000 records are contained in the database,
  ranging from historical observations made in the 1800s to present day sightings.\",\n\t\"license_title\":
